class Solution {
    using ll = long long int;
public:
    int minimumCost(string target, vector<string>& words, vector<int>& costs) {
        int n = target.size();
        vector<ll> dp(n + 1, 1e11);
        dp[0] = 0;  

        unordered_map<string, ll> wordCostMap;
        for (int i = 0; i < words.size(); ++i) {
            if(wordCostMap[words[i]] == 0) {
                wordCostMap[words[i]] = costs[i];
            }
            else{
                wordCostMap[words[i]] = min(wordCostMap[words[i]], 1ll*costs[i]);
            }
        }

        for (int j = 1; j <= n; ++j) {
            for (auto& pair : wordCostMap) {
                const string& word = pair.first;
                int cost = pair.second;
                int len = word.size();
                if (j >= len && target.compare(j - len, len, word) == 0) {
                    if (dp[j - len] != 1e11) {
                        dp[j] = min(dp[j], dp[j - len] + cost);
                    }
                }
            }
        }

        return dp[n] >= 1e11 ? -1 : dp[n];
    }
};
